import React from 'react';
import { Link } from 'react-router-dom';

class Nav extends React.Component {
    render() {
        return (
            <div className="nav">
                <ul>
                    <li>
                        <Link to="/">Home</Link>    
                    </li>
                    <li>
                        <Link to="/about-us">Meet the Band!</Link>
                    </li>
                    <li>
                        <Link to="/contact-us">Book a Gig!</Link>
                    </li>
                </ul>
            </div>
        )
    }
}

export default Nav;
